webpackJsonp([0x27b4d3565dab9a00],{"./node_modules/json-loader/index.js!./.cache/json/miscellaneous-testing-with-chaijs.json":function(e,a){e.exports={data:{markdownRemark:{html:"<p><a href='http://chaijs.com' target='_blank' rel='nofollow'>Chai</a> is a testing library for Node.js.</p>\n<h3>Installation</h3>\n<p>You can install Chai in your project through npm.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code>npm install chai</code></pre>\n      </div>\n<h5>Pro-tip</h5>\n<p>Add Chai in devDependencies of  <em>package.json</em>, using * as version tag. In this way, you always have the most recent version.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code>\"devDependencies\": {\n  \"chai\": \"*\"\n}</code></pre>\n      </div>\n<h3>How to use</h3>\n<h4>Assert</h4>\n<p>You can use <em>assert</em> to check if your tests are performing well.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code>var assert = require('chai').assert, foo = 'bar', beverages = { tea: [ 'chai', 'matcha', 'oolong' ] };\n\nassert.typeOf(foo, 'string'); // without optional message\nassert.typeOf(foo, 'string', 'foo is a string'); // with optional message\nassert.equal(foo, 'bar', 'foo equal `bar`');\nassert.lengthOf(foo, 3, 'foo`s value has a length of 3');\nassert.lengthOf(beverages.tea, 3, 'beverages has 3 types of tea');</code></pre>\n      </div>\n<h3>More info:</h3>\n<ul>\n<li><code>help chai assert</code></li>\n<li><code>help chai expectations</code></li>\n</ul>",fields:{slug:"/miscellaneous/testing-with-chaijs/"},frontmatter:{title:"Testing with Chaijs"}}},pathContext:{slug:"/miscellaneous/testing-with-chaijs/"}}}});
